const users = (state = [], action) => {
    switch (action.type) {
        case 'ADD_NEW_USER':
            return [
                ...state,
                {
                    id: action.user.id,
                    name: action.user.name,
                    phone: action.user.city,
                    city: action.user.city,
                    dob: action.user.dob,
                    weight: action.user.weight,
                    blood_type: action.user.blood_type
                }
            ]
        default: 
            return state
    }
}

export default users;
